import { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom'
import style from './Detail.module.css';
import { Link } from "react-router-dom";
import { connect } from 'react-redux';
import { getDetailCharacter } from '../../redux/actions';

const Detail = () =>{
  const { id } = useParams();
  const [character, setCharacter ] = useState({});
  
  useEffect(() => {
    fetch(`http://localhost:3001/rickandmorty/character/${id}`)
    .then((response) => response.json()) // Nos brinda info de la api y la parseamos
    .then((char) => {
      if (char.name) {
        setCharacter(char);
      } 
      else {
        alert("Character doesn't exist with this ID");
      }
    })
    .catch((error) => {
      alert("Character doesn't exist with this ID");
    });

    return setCharacter({});
  }, [id]);
  
  return (
    <>
      <Link className={style.divReturnBack} to='/home'>
        <span>Return Back</span>
        <img className={style.arrow} src="data:image/png;base64," alt="arrow" />
      </Link>
      <div className={style.divDetail}>
        <h2>Detail</h2>
        {
          character ? (
            <div className={style.divContainer}>
              <div className={style.divInfo}>
                  <h2>Name | {character.name}</h2>
                  <h2 className={style.class2}>Status | {character.status}</h2>
                  <h2>Specie | {character.species}</h2>
                  <h2 className={style.class2}>Gender | {character.gender}</h2>
                  <h2>Origin | {character.origin?.name}</h2>
              </div>
              <div className={style.divImg}>
                  <img src={character.image} alt={character.name} />
              </div>
            </div>
          ) : (
            ''
          )
        }
      </div>
    </>
  );
}

export function mapDispatchToProps(dispatch) {
  return {
    getDetailCharacter: (id) => dispatch(getDetailCharacter(id)),
  }
}

export default connect(null, mapDispatchToProps)(Detail);
